#!/data/data/com.termux/files/usr/bin/sh

set -e

tab='	'
nl='
'
IFS=" $tab$nl"

umask=`umask`
umask 77

xztmpdir=
trap 'res=$?
  test -n "$xztmpdir" && rm -fr "$xztmpdir"
  (exit $res); exit $res
' 0 1 2 3 5 10 13 15

case $TMPDIR in
  / | /*/) ;;
  /*) TMPDIR=$TMPDIR/;;
  *) TMPDIR=/data/data/com.termux/files/usr/tmp/;;
esac
if type mktemp >/dev/null 2>&1; then
  xztmpdir=`mktemp -d "${TMPDIR}xztmpXXXXXXXXX"`
else
  xztmpdir=${TMPDIR}xztmp$$; mkdir $xztmpdir
fi || { (exit 127); exit 127; }

xztmp=$xztmpdir/$0
case $0 in
-* | */*'
') mkdir -p "$xztmp" && rm -r "$xztmp";;
*/*) xztmp=$xztmpdir/`basename "$0"`;;
esac || { (exit 127); exit 127; }

case `printf 'X\n' | tail -n +1 2>/dev/null` in
X) -n;;
*) ;;
esac
if tail $ +$ <"$0" | xz -cd > "$xztmp"; then
  umask $umask
  chmod 700 "$xztmp"
  (sleep 5; rm -fr "$xztmpdir") 2>/dev/null &
  "$xztmp" ${1+"$@"}; res=$?
else
  printf >&2 '%s\n' " $0"
  (exit 127); res=127
fi; exit $res
